import React from 'react'
import logo from '../images/logo.png'


export default function NavBar() {
    return (
        <div style={{background: "transparent", textAlign: "center", }}>
            <img alt="Hogwarts" src={logo} style={{width: "50px", marginTop: "20px"}}/>
        </div>
    )
}
